import React, { useEffect, useRef } from 'react'

function Nav({handleCampaignType}){
    const upcomingCampaignRef  = useRef(null) ;
    useEffect(()=>{
        upcomingCampaignRef.current.focus();
    },[])

    var handleClick = (e)=>{
        e.target.className= "clicked-link" ;
    }
    return(
        <nav className="navBar">
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(1)}} className='link' ref={upcomingCampaignRef} >Upcoming Campaings</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(0)}} className='link' onClick={handleClick}>Live Campaigns</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(-1)}} className='link'>Past Campaings</a>
        </nav>
    )
}

export default Nav ;
